import React, {useEffect, useState} from 'react'
import axios from 'axios'
import { useParams } from 'react-router-dom'
import { useNavigate } from 'react-router-dom'


function UpdateVehicle() {

    const [inputs, setInputs] = useState({});
    const history = useNavigate();
    const id = useParams().id;

    useEffect(()=>{
        const fetchHandler = async ()=>{
            await axios
            .get(`http://localhost:5000/vehicles/${id}`)
            .then((res)=> res.data)
            .then((data)=> setInputs(data.vehicle));
        };
        fetchHandler();
    },[id]);

    const sendRequest = async ()=>{
        await axios
        .put(`http://localhost:5000/vehicles/${id}`,{
            vin: String (inputs.vin),
            regNo: String (inputs.regNo),
            make: String (inputs.make),
            model: String (inputs.model),
            year: Number (inputs.year),
            ownerName: String (inputs.ownerName),
            ownerNic: Number (inputs.ownerNic),
            ownerEmail: String (inputs.ownerEmail),
            ownerAddress: String (inputs.ownerAddress),
            contactNo: Number (inputs.contactNo),
        })
            .then((res) => res.data);
    };

    const handleChange =(e)=>{
        setInputs((prevState)=> ({
            ...prevState,
            [e.target.name]: e.target.value,
        }));
      };
    
      const handleSubmit =(e)=>{
        e.preventDefault();
        console.log(inputs);
        sendRequest().then(()=>
        history('/vehicledetails'));
      };

  return (
    <div>
      <h1>Update Vehicle</h1>
      <form onSubmit={handleSubmit}>
        <label>Vehicle Identification Number</label>
        <br />
        <input type="text" name="vin" onChange={handleChange} value={inputs.vin} required></input>
        <br></br>
        <br></br>
        <label>Registration Number</label>
        <br />
        <input type="text" name="regNo" onChange={handleChange} value={inputs.regNo} required></input>
        <br></br>
        <br></br>
        <label>Make</label>
        <br />
        <input type="text" name="make" onChange={handleChange} value={inputs.make} required></input>
        <br></br>
        <br></br>
        <label>Model</label>
        <br />
        <input type="text" name="model" onChange={handleChange} value={inputs.model} required></input>
        <br></br>
        <br></br>
        <label>Year</label>
        <br />
        <input type="text" name="year" onChange={handleChange} value={inputs.year} required></input>
        <br></br>
        <br></br>
        <label>Owner Name</label>
        <br />
        <input type="text" name="ownerName" onChange={handleChange} value={inputs.ownerName} required></input>
        <br></br>
        <br></br>
        <label>Owner NIC</label>
        <br />
        <input type="text" name="ownerNic" onChange={handleChange} value={inputs.ownerNic} required></input>
        <br></br>
        <br></br>
        <label>Owner Email</label>
        <br />
        <input type="email" name="ownerEmail" onChange={handleChange} value={inputs.ownerEmail} required></input>
        <br></br>
        <br></br>
        <label>Owner Address</label>
        <br />
        <input type="text" name="ownerAddress" onChange={handleChange} value={inputs.ownerAddress} required></input>
        <br></br>
        <br></br>
        <label>Contact Number</label>
        <br />
        <input type="text" name="contactNo" onChange={handleChange} value={inputs.contactNo} required></input>
        <br></br>
        <br></br>
        <button>Submit</button>
      </form>
    </div>
  )
}

export default UpdateVehicle
